import{
  createBrowserRouter,
  RouterProvider,
  Route,
} from "react-router-dom";

const router= createBrowserRouter([
  {
    path: "/",
    element: <div> this is home!</div>
  },
])


function App() {
  return (
    <div >
      <RouterProvider router={router}></RouterProvider>
    </div>
  );
}

export default App;
